import React, { useState, useEffect } from 'react';
import Autosuggest from 'react-autosuggest';
import logo from './components/logo.png';
import surnames from './components/autosuggest/surname.json';
import firstnames from './components/autosuggest/firstname.json';
import partners from './components/autosuggest/partners.json';
import './FeedbackPage.css';

const FeedbackPage = () => {
  const navigate = useNavigate();
  const [textVisible, setTextVisible] = useState(true);

  return (
    <div className="feedback-container">
      <div className="logo"/>
      <h1 className={`welcome-text ${textVisible ? '' : 'slideDownDisappear'}`}>Оценка мероприятия</h1>
    </div>
  );
};

export default FeedbackPagePage;
